import React from 'react';
import { Typography, Button, Drawer, Divider, List, ListItem, Hidden, ClickAwayListener } from '@material-ui/core'
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import { Link } from 'react-router-dom';
import { useLocation } from 'react-router-dom';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
  },
}));

export default function NavigationBar(props) {
  const classes = useStyles();
  let location = useLocation().pathname;
  const [open, setOpen] = React.useState(false)
  const clickedLink = {color: '#d2ac2b', padding: '20px', textDecoration: 'none'}
  const unclickedLink = {color: '#929497', padding: '20px', textDecoration: 'none'}

  const handleDrawerOpen = () => {
    setOpen(true);
  };

  const handleDrawerClose = () => {
    setOpen(false);
  };

  return (
    <div className={classes.root}>
      <AppBar position="static" >
        <Toolbar>
          <IconButton edge="start" className={classes.menuButton} color="inherit" aria-label="menu">
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" className={classes.title}>
            TestApp
          </Typography>
          {/* <Button color="inherit">Login</Button> */}
          <Hidden smDown>  
          <Link
                to='/'
                onClick={handleDrawerClose}
            >
                <Typography>
                    BUSINESS POSTS
                </Typography>
            </Link>
    ,
            <Link
                to='/testpage2'
                onClick={handleDrawerClose}
            >
                <Typography>
                    NEWSLETTERS
                </Typography>
            </Link>
                    </Hidden>
                    <Hidden mdUp>
                        <IconButton
                            color="primary"
                            aria-label="open drawer"
                            edge="end"
                            onClick={handleDrawerOpen}
                        >
                            <MenuIcon />
                        </IconButton>
          </Hidden>
        </Toolbar>
      </AppBar>
    </div>
  );
}
